var data = require("foxie-data"),
		jade = require("jade"),
		api = require("foxie-api"),
		api = {
			machineName:api.misc.machineName,
			newData:api.data.extend
		}

var compiled = []

module.exports = function(themeObjs,themeName){

//make keys

var thisTheme = {}

for(partial in themeObjs[themeName]){

	var keys = themeObjs[themeName][partial].split("/").pop()
	var keys = keys.split(".")[0]

	var compile = themeObjs[themeName][partial]
	thisTheme[keys] = compile
}

data.themes[api.machineName(themeName)] = thisTheme


}
